import axios from '@/libs/api.request'

export const getTabList = () => {
    return axios.request({
        url: 'PlayTypes',
        method: 'get'
    })
}

export const getTabListForOne = (req) => {
    return axios.request({
        url: 'PlayTypes/' + req,
        method: 'get'
    })
}

export const updateTab = (paramsstr, Id) => {
    const data = paramsstr
    return axios.request({
        url: 'PlayTypes/' + Id,
        data,
        method: 'put'
    })
}

//添加
export const addTab = (paramsstr) => {
    const data = paramsstr
    return axios.request({
        url: 'PlayTypes',
        data,
        method: 'post'
    })
}

//删除
export const deleteTeamTab = (req) => {
    return axios.request({
        url: 'PlayTypes/' + req,
        method: 'delete'
    })
}
